import React from "react";
import '../App.css';
import NavigationMenu from "./NavigationMenu";


function Nav() {

    const handleClick = (anchor) => {
        const id = `${anchor}-section`;
        console.log(id)
        const element = document.getElementById(id);
        if (element) {
          element.scrollIntoView({
            behavior: "smooth",
            block: "start",
          });
        }
      };

    return (
        <div className="navbar">
            <NavigationMenu />
        </div>
    );
}

export default Nav;
